BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "comptageRoutier" (
	"id"	INTEGER NOT NULL UNIQUE,
	"identifiant"	TEXT,
	"libelle"	TEXT,
	"horodatage"	TEXT,
	"debitHoraire"	NUMERIC,
	"tauxOccupation"	NUMERIC,
	"etatTrafic"	TEXT,
	"etatArc"	TEXT,
	"libelleAmont"	TEXT,
	"libelleAval"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
